def evalRPN(tokens):
    stack = []
    for token in tokens:
        if token not in '+-*/':
            stack.append(int(token))
        else:
            second = stack.pop()
            first = stack.pop()
            if token == '+':
                stack.append(first+second)
            elif token == '-':
                stack.append(first-second)
            elif token == '*':
                stack.append(first*second)
            else:
                if first*second < 0 and first % second != 0:
                    stack.append(first/second+1)
                else:
                    stack.append(first/second)
    return int(stack[0])

